        <Box  justifyContent="center" alignItems="center" mt={"$10"} >
            <Box backgroundColor='red' width= {'$full'} >
                <Box bgColor='#FFA600' height="205px" borderRadius="0 0 10px 10px" width={'$full'}>
                    <Avatar bgColor="$black" size="xl" borderRadius="$full">
                        <AvatarFallbackText>Sandeep Srivastava</AvatarFallbackText>
                    </Avatar>
                </Box>

                <Box>

                </Box>
            </Box>
                
                <Button position='absolute' width="305px" backgroundColor='#FFA600' color='white' marginTop={"100%"}>
                    <ButtonText >
                        Order
                    </ButtonText>

                </Button>

        </Box>

    ); 
}


export default Bagview;
